function Jumbotron({ fluidchildren }) {
  return (
    <div
      style={{ height: 300, clear: "both", textAlign: "center" }}
      className= {fluid ? "jumbotron jumbotron-fluid" : "jumbotron"}
    >
      {children}
    </div>
  );
}

export default Jumbotron;
